import React from 'react'

const Login = () => {
  return (
    <div>
        <div className='login-div-left'>
            <div className='login-left-text'></div>
            <div className='login-left-logo'></div>
        </div>
        <div className='login-div-right'></div>
    </div>
  )
}

export default Login
